import { useState } from 'react';
import './App.css';
import Books from './components/Books';
import bookData from './bookData.json';

const BOOKS = bookData;

const App = () => {
  const [books, setBooks] = useState(BOOKS);

  return (
    <div>
      <Books items={books}/>
    </div>
  );
}

export default App;
